import { motion } from "framer-motion"
import Player from "./Player";
function HomePage(){
    return <div class="StreamPageMainDiv">
        <motion.div 
        
        animate={{
            x:0
        }}
        whileHover={{ scale: 1.5 }}
        whileTap={{ scale: 0.9 }}
            children={
                <div>
                    <h3 style={{textAlign:"center"}}><h1 style={{display:"inline",color:"#6209b6"}}>M</h1>anyu <h1 style={{display:"inline",color:"#6209b6"}}>D</h1>uttaluri</h3>
                    <h3 >Full Stack</h3>
                </div>
            }
        />
        
        <center>
            <motion.div whileHover={{scale:2}}>
            <div class="Dashboard">
                <h3>
                    Dashboard
                    <Player/>
                </h3>
            </div>
            </motion.div>
        </center>
    </div>;
}


export default HomePage;
